// Match expense dates with revenue periods and combine the data
const expenses = $input.first().json.expenses || [];
const revenue = $input.last().json.revenue || [];

const matchedData = [];

// Process each expense and match to revenue period
for (const expense of expenses) {
  const expenseDate = new Date(expense.date);

  // Find matching revenue period
  const matchingRevenue = revenue.find(rev => {
    const periodStart = new Date(rev.periodStart);
    const periodEnd = new Date(rev.periodEnd);
    return expenseDate >= periodStart && expenseDate <= periodEnd;
  });

  matchedData.push({
    expense: expense,
    revenue: matchingRevenue || null,
    matched: !!matchingRevenue
  });
}

return matchedData.map(item => ({ json: item }));

// Calculate tax deductions by applying percentages to expenses
// Group by revenue period and compute revenue minus deductions

const items = $input.all();
const results = [];

// Group expenses by revenue period
const periodMap = new Map();

for (const item of items) {
  const period = item.json.revenuePeriod || 'Unknown';
  const revenue = item.json.revenue || 0;
  const expenseAmount = item.json.expenseAmount || 0;
  const deductionPercentage = item.json.deductionPercentage || 0;

  // Calculate deduction amount
  const deductionAmount = expenseAmount * (deductionPercentage / 100);

  if (!periodMap.has(period)) {
    periodMap.set(period, {
      period: period,
      revenue: revenue,
      totalDeductions: 0,
      expenses: []
    });
  }

  const periodData = periodMap.get(period);
  periodData.totalDeductions += deductionAmount;
  periodData.expenses.push({
    amount: expenseAmount,
    deductionPercentage: deductionPercentage,
    deductionAmount: deductionAmount,
    category: item.json.category || 'Uncategorized'
  });
}

// Calculate net amounts for each period
for (const [period, data] of periodMap) {
  results.push({
    json: {
      period: data.period,
      revenue: data.revenue,
      totalDeductions: data.totalDeductions,
      netAmount: data.revenue - data.totalDeductions,
      expenses: data.expenses,
      expenseCount: data.expenses.length
    }
  });
}

return results;

